import React from "react";
import Athlete from "./Athlete";

const Results = ({athlete}) => {
    return  (
        <div className="results">
            {!athlete.length ? (
                <h1>No Athletes Found</h1>
            ) :  (
                        <Athlete 
                        name={athlete.name}
                        sport={athlete.sport}
                        id={athlete.id}
                        key={athlete.id}
                        sleepQuality={athlete.data.sleepQuality}
                        soreness={athlete.data.soreness}
                        date={athlete.date}
                        />
                    )
            }
        </div>
    )
}

export default Results;
